When the SDK throws, it throws an instance of ZKsyncError. Use isZKsyncError(e) to narrow and read the error envelope . import { isZKsyncError } from '@matterlabs/zksync-js/core'; try { const handle = await sdk.deposits.create(params);
} catch (e) { if (isZKsyncError(e)) { const err = e; // type-narrowed const { type, resource, operation, message, context, revert } = err.envelope; switch (type) { case 'VALIDATION': case 'STATE': // user/action fixable (bad input, not-ready, etc.) break; case 'EXECUTION': case 'RPC': // network/tx/provider issues break; } console.error(JSON.stringify(err.toJSON())); // structured log } else { throw e; // non-SDK error }
}

