llet balance on L2 after:', L2balanceAfter); /* // OPTIONAL: ADVANCED CONTROL // The SDK also lets you inspect a transaction before sending it. // This follows the Mental Model: quote -> prepare -> create. // Uncomment the code below to see it in action. const params = { token: ETH_ADDRESS, amount: parseEther('0.001'), to: account.address, // Optional: pin gas fees instead of using provider estimates // l1TxOverrides: { // gasLimit: 280_000n, // maxFeePerGas: parseEther('0.00000002'), // 20 gwei // maxPriorityFeePerGas: parseEther('0.000000002'), // 2 gwei // }, }; // Get a quote for the fees const quote = await sdk.deposits.quote(params); console.log('Fee quote:', quote); // Prepare the transaction without sending const plan = await sdk.deposits.prepare(params); console.log('Transaction plan:', plan); */
