// examples/viem/withdrawals-eth.ts
import { createPublicClient, createWalletClient, http, parseEther, type Account, type Chain, type Transport,
} from 'viem';
import { privateKeyToAccount, nonceManager } from 'viem/accounts'; import { createViemSdk, createViemClient } from '@matterlabs/zksync-js/viem';
import { ETH_ADDRESS } from '@matterlabs/zksync-js/core'; const L1_RPC = 'http://localhost:8545'; // e.g. https://sepolia.infura.io/v3/XXX
const L2_RPC = 'http://localhost:3050'; // your L2 RPC
const PRIVATE_KEY = process.env.PRIVATE_KEY || ''; async function main() { if (!PRIVATE_KEY) { throw new Error('Set your PRIVATE_KEY (0x-prefixed 32-byte) in env'); } // --- Viem clients --- const account = privateKeyToAccount(PRIVATE_KEY as `0x${string}`); const l1 = createPublicClient({ transport: http(L1_RPC) }); const l2 = createPublicClient({ transport: http(L2_RPC) }); const l1Wallet = createWalletClient<Transport, Chain, Account>({ account, transport: http(L1_RPC), }); const l2Wallet = createWalletClient<Transport, Chain, Account>({ account, transport: http(L2_RPC), }); const client = createViemClient({ l1, l2, l1Wallet, l2Wallet }); const sdk = createViemSdk(client); const me = account.address; // Withdraw ETH const params = { token: ETH_ADDRESS, amount: parseEther('0.01'), to: me, // l2GasLimit: 300_000n, // optional } as const; // Quote (dry run) const quote = await sdk.withdrawals.quote(params); console.log('QUOTE:', quote); // Prepare (no sends) const plan = await sdk.withdrawals.prepare(params); console.log('PREPARE:', plan); // Create (send L2 withdraw) const created = await sdk.withdrawals.create(params); console.log('CREATE:', created); // Quick status console.log('STATUS (initial):', await sdk.withdrawals.status(created.l2TxHash)); // Wait for L2 inclusion const l2Receipt = await sdk.withdrawals.wait(created, { for: 'l2' }); console.log( 'L2 included: block=', l2Receipt?.blockNumber, 'status=', l2Receipt?.status, 'hash=', l2Receipt?.transactionHash, ); // Wait until ready to finalize await sdk.withdrawals.wait(created.l2TxHash, { for: 'ready' }); console.log('STATUS (ready):', await sdk.withdrawals.status(created.l2TxHash)); // Try to finalize on L1 const fin = await sdk.withdrawals.tryFinalize(created.l2TxHash); console.log('TRY FINALIZE:', fin); const l1Receipt = await sdk.withdrawals.wait(created.l2TxHash, { for: 'finalized' }); if (l1Receipt) { console.log('L1 finalize receipt:', l1Receipt.transactionHash); } else { console.log('Finalized (no local L1 receipt — possibly finalized by someone else).'); }
} main().catch((e) => { console.error(e); process.exit(1);
}); create() prepares and sends the L2 withdrawal. wait(..., { for: 'l2' }) ⇒ included on L2. wait(..., { for: 'ready' }) ⇒ ready for finalization. finalize(l2TxHash) ⇒ required to release funds on L1.

